import React from 'react';
import { BarChart, Bar, Rectangle, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
const data = [
    {
        name: 'January',
        uv: 4000,
        pv: 2400,
        amt: 2400,
    },
    {
        name: 'Febuary',
        uv: 3000,
        pv: 1398,
        amt: 2210,
    },
    {
        name: 'March',
        uv: 2000,
        pv: 9800,
        amt: 2290,
    },
    {
        name: 'April',
        uv: 2780,
        pv: 3908,
        amt: 2000,
    },
    {
        name: 'May',
        uv: 1890,
        pv: 4800,
        amt: 2181,
    },
    {
        name: 'June',
        uv: 2390,
        pv: 3800,
        amt: 2500,
    },
    {
        name: 'July',
        uv: 3490,
        pv: 4300,
        amt: 2100,
    },
    {
        name: 'August',
        uv: 3000,
        pv: 2300,
        amt: 2100,
    },
    {
        name: 'September',
        uv: 3490,
        pv: 1300,
        amt: 2100,
    },
    {
        name: 'October',
        uv: 3490,
        pv: 5400,
        amt: 2100,
    },
    {
        name: 'November',
        uv: 3490,
        pv: 1700,
        amt: 2100,
    },
    {
        name: 'December',
        uv: 3490,
        pv: 4300,
        amt: 2100,
    },
];

const ChartChad = ({}) =>{
    return (
        <ResponsiveContainer width="100%" height={300}>
            <BarChart
                width={500}
                height={300}
                data={data}
                margin={{
                    top: 5,
                    right: 10,
                    left: 10,
                    bottom: 5
                }}
            >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="pv" fill="#3E215B" />
            </BarChart>
        </ResponsiveContainer>
    );
}

export default ChartChad;
